webpackJsonp([0xf4107243a075],{3416:function(t,a){t.exports={data:{markdownRemark:{html:"<p>自分が初めて描いた漫画の1コマ。\n漫画のタイトルは無し、ストーリーの脈絡は全くないありきたりなギャグもの4コマ漫画だった。</p>\n<p>登場キャラはベレー帽(アフロ？)の人(写真左: 仕掛け役)、髪の毛3本だけの人(ハメられ役)の2人のみ。\n後半になると、ハメられ役の方はずっと猿マスクをかぶっていて(写真右)、さらに終盤になると扱いすら完全にサル化していた。</p>\n<p>残念ながら当時描いていたものは見つからず、このイラストは 2000 ～ 2001 年頃に当時の画力を思い出しつつ再現したもの。</p>\n<p>ちなみに体は棒人間だが、拡大すると足の親指くらいの太さはある。\n(実際に太さを表現したシーンがあるｗ)</p>",frontmatter:{cover:null,date:"1992-01-13T10:00:00+09:00",strDate:"1992/1/13",title:"オリジナルコミック “無題”"}}},pathContext:{path:"/ja/blog/1992/01/13-yonkoma/",langKey:"ja"}}}});
